// src/pages/AdminDashboard.js

import React from 'react';
import { NavLink, Route, Routes } from 'react-router-dom';

// Placeholder components for each admin section
const DashboardHome = () => <div>Welcome to the Admin Dashboard</div>;
const Bookings = () => <div>Manage Bookings</div>;
const Customers = () => <div>Manage Customers</div>;
const Payments = () => <div>Manage Payments</div>;

const AdminDashboard = () => {
  return (
    <div className="container-fluid">
      <div className="row">
        {/* Sidebar */}
        <nav className="col-md-2 d-none d-md-block bg-light sidebar">
          <div className="sidebar-sticky">
            <ul className="nav flex-column">
              <li className="nav-item">
                <NavLink
                  to="/admin/dashboard"
                  className={({ isActive }) => (isActive ? 'nav-link active-nav' : 'nav-link')}
                >
                  Dashboard
                </NavLink>
              </li>
              <li className="nav-item">
                <NavLink
                  to="/admin/bookings"
                  className={({ isActive }) => (isActive ? 'nav-link active-nav' : 'nav-link')}
                >
                  Bookings
                </NavLink>
              </li>
              <li className="nav-item">
                <NavLink
                  to="/admin/customers"
                  className={({ isActive }) => (isActive ? 'nav-link active-nav' : 'nav-link')}
                >
                  Customers
                </NavLink>
              </li>
              <li className="nav-item">
                <NavLink
                  to="/admin/payments"
                  className={({ isActive }) => (isActive ? 'nav-link active-nav' : 'nav-link')}
                >
                  Payments
                </NavLink>
              </li>
            </ul>
          </div>
        </nav>

        {/* Main Content */}
        <main role="main" className="col-md-9 ml-sm-auto col-lg-10 px-4">
          <Routes>
            <Route path="/admin/dashboard" element={<DashboardHome />} />
            <Route path="/admin/bookings" element={<Bookings />} />
            <Route path="/admin/customers" element={<Customers />} />
            <Route path="/admin/payments" element={<Payments />} />
          </Routes>
        </main>
      </div>
    </div>
  );
};

export default AdminDashboard;
